import React from 'react';
import './App.css'; // Make sure the CSS file is correctly imported
import Data from './Data'; // Assuming you have a Data.js file containing the card info
import Card from './Card'; // The Card component

function App() {
  return (
    <>
      <h1 className="heading_style">Featured Cards</h1>
      <div className="cards">
        {Data.map((val, index) => {
          return (
            <Card
              key={index}
              imgsrc={val.imgsrc}
              title={val.title}
              name={val.name}
              reference={val.reference}
            />
          );
        })}
      </div>
    </>
  );
}

export default App;
